import React from 'react';

import { Box, Flex } from 'reflexbox';

const Navigation = () => (
    <Flex justifyContent='space-between'>
        <Box>
            <b>votsec</b>
        </Box>

        <Flex>
            <Box>about</Box>
            <Box>login</Box>
            <Box>sign up</Box>
        </Flex>
    </Flex>
);

const App = () => (
    <Navigation />
);

export default App;
